CREATE TABLE omnivore.discover_feed_articles (
    id uuid PRIMARY KEY,
    feed_id uuid NOT NULL REFERENCES omnivore.discover_feed(id) ON DELETE CASCADE,
    title text NOT NULL,
    slug text NOT NULL,
    description text,
    url text NOT NULL,
    author text,
    image text,
    published_at timestamptz NOT NULL DEFAULT current_timestamp,
    embedding vector(1536),
    UNIQUE(slug)
);

GRANT SELECT ON omnivore.discover_feed_articles TO omnivore_user;

CREATE TABLE omnivore.discover_feed_save_link (
   discover_article_id uuid NOT NULL REFERENCES omnivore.discover_feed_articles(id) ON DELETE CASCADE,
   user_id uuid NOT NULL REFERENCES omnivore.user(id) ON DELETE CASCADE,
   article_save_id uuid NOT NULL REFERENCES omnivore.library_item(id) ON DELETE CASCADE,
   article_save_url text,
   created_at timestamptz NOT NULL DEFAULT current_timestamp,
   deleted bool NOT NULL DEFAULT false,
   CONSTRAINT user_discover_feed_link UNIQUE(discover_article_id, user_id)
);

GRANT SELECT, INSERT, UPDATE, DELETE ON omnivore.discover_feed_save_link to omnivore_user;

CREATE TABLE omnivore.discover_feed_article_topic_link (
    discover_feed_article_id uuid NOT NULL REFERENCES omnivore.discover_feed_articles(id) ON DELETE CASCADE,
    discover_topic_name text NOT NULL REFERENCES omnivore.discover_topics(name) ON DELETE CASCADE,
    UNIQUE (discover_feed_article_id, discover_topic_name)
);

GRANT SELECT ON omnivore.discover_feed_article_topic_link to omnivore_user;

